import React, { useState } from 'react';
import axios from 'axios';

const MarksForm = () => {
  const [formData, setFormData] = useState({
    telugu: '',
    hindi: '',
    english: '',
    maths: '',
    science: '',
    social: '',
    studentId: {
      studentId: ''
    }
  });

  const handleChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    // Send the marks data to the backend API
    axios.post('http://localhost:8080/addMarks', formData)
      .then(response => {
        // Handle success if needed
      })
      .catch(error => {
        // Handle error if needed
      });

    // Reset the form
    setFormData({
      telugu: '',
      hindi: '',
      english: '',
      maths: '',
      science: '',
      social: '',
      studentId: {
        studentId: ''
      }
    });
  };

  return (
    <div>
      <h1>Add Marks</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="telugu">Telugu:</label>
        <input type="number" id="telugu" name="telugu" value={formData.telugu} onChange={handleChange} required /><br /><br />
        <label htmlFor="hindi">Hindi:</label>
        <input type="number" id="hindi" name="hindi" value={formData.hindi} onChange={handleChange} required /><br /><br />
        <label htmlFor="english">English:</label>
        <input type="number" id="english" name="english" value={formData.english} onChange={handleChange} required /><br /><br />
        <label htmlFor="maths">Maths:</label>
        <input type="number" id="maths" name="maths" value={formData.maths} onChange={handleChange} required /><br /><br />
        <label htmlFor="science">Science:</label>
        <input type="number" id="science" name="science" value={formData.science} onChange={handleChange} required /><br /><br />
        <label htmlFor="social">Social:</label>
        <input type="number" id="social" name="social" value={formData.social} onChange={handleChange} required /><br /><br />
        <label htmlFor="studentId">Student ID:</label>
        <input type="number" id="studentId" name="studentId.studentId" value={formData.studentId.studentId} onChange={handleChange} required /><br /><br />
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};

export default MarksForm;
